var getBands = function (ls,type) {
  if (type == 'fcc'){
    // FCC
    return ['nir','red','green'];
  } else if (type == 'rcc'){
    // RGB
    return ['red','green','blue'];
  } else if (type == 'VIs'){
    return ['NDVI','NDWI','NDWI']
  }
}
